import React from 'react';
import '../App.css';

function scene_2() {
  return (
    <div className ="scene_2">
      <div className ="bicycles"> <img src="program/bicycles.png" width="100%" alt="" ></img> </div>
			<div className ="block_location_2_2">
				<div className ="title paragraph_indentation">Веломастерская “Велозар”</div>
				<div className ="paragraph">В нашей мастерской можно выполнить комплексное техническое обслуживание велосипеда, ремонт и настройку всех его узлов, шиномонтажные работы. Вовремя проведенное ТО велосипеда помогает избежать многих проблем и дорогого ремонта.  Все работы выполняем качественно и с душой. </div>
			</div>
    </div>
  );
}
export default scene_2;
